import {useEffect, useState} from "react";
import TableHead from "./TableHead";
import Skeleton from "./Skeleton";
import { getSpatable } from "D:/работа/Projects/Spa_table1/node-postgres/spatable_model.js";

const data = [getSpatable]


function Table() {

    return (
              <div className="Table">
<table>
        <tr>
          <th>Date</th>
          <th>Name</th>
          <th>Quanity</th>
          <th>Distance</th>
        </tr>
        {data.map((val, key) => {
          return (
            <tr key={key}>
              <td>{val.date}</td>
              <td>{val.name}</td>
              <td>{val.quanity}</td>
              <td>{val.distance}</td>
            </tr>
          )
        })}
      </table>
    </div>
  );
}
  

export default Table;
